const Homepage = ({ isLoggedIn, currentUser }) => {

    return (
        <div className="homepage-container">
            Welcome to Strangers Things!
            <br></br>
            {
                isLoggedIn ? 

                    <div id='homepage-logged-in display'>
                    `We're logged in as ${currentUser.username}`

                    </div>

                : "Log In Please"
            }




        </div>
    )
}

export default Homepage;
